import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Navbar, Nav, Container, Row, Col, Button, Card, Carousel } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import Logo from './components/Logo';
import Home from './components/pages/Home';
import About from './components/pages/About';
import Events from './components/pages/Events';
import Gallery from './components/pages/Gallery';
import Membership from './components/pages/Membership';
import Contact from './components/pages/Contact';
import AdminLogin from './components/admin/AdminLogin';
import AdminDashboard from './components/admin/AdminDashboard';

const ProtectedRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('adminAuthenticated') === 'true';
  return isAuthenticated ? children : <Navigate to="/admin" replace />;
};

const App = () => {
  const [scrolled, setScrolled] = useState(false);
  const [showScrollTop, setShowScrollTop] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const offset = window.scrollY;
      setScrolled(offset > 50);
      setShowScrollTop(offset > 300);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: 'smooth' });
  };

  return (
    <Router>
      <div className="App">
        {/* Navigation */}
        <Navbar 
          expand="lg" 
          fixed="top" 
          className={`navbar-custom ${scrolled ? 'scrolled' : ''}`}
        >
          <Container>
            <Navbar.Brand as={Link} to="/">
              <Logo />
            </Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="ms-auto">
                <Nav.Link as={Link} to="/" className="nav-link">Home</Nav.Link>
                <Nav.Link as={Link} to="/about" className="nav-link">About</Nav.Link>
                <Nav.Link as={Link} to="/events" className="nav-link">Events</Nav.Link>
                <Nav.Link as={Link} to="/gallery" className="nav-link">Gallery</Nav.Link>
                <Nav.Link as={Link} to="/membership" className="nav-link">Membership</Nav.Link>
                <Nav.Link as={Link} to="/contact" className="nav-link">Contact</Nav.Link>
                <Nav.Link as={Link} to="/admin" className="admin-link">Admin</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        {/* Hero Section */}
        <Carousel className="hero-section">
          <Carousel.Item>
            <div className="hero-content">
              <Container>
                <Row className="align-items-center min-vh-100">
                  <Col lg={6} className="text-start">
                    <h1 className="display-4 fw-bold mb-4">Welcome to Edo Cultural Association Italy</h1>
                    <p className="lead mb-4">Preserving and promoting Edo culture in Italy</p>
                    <Button variant="primary" size="lg" className="me-3">Join Us</Button>
                    <Button variant="outline-light" size="lg">Learn More</Button>
                  </Col>
                </Row>
              </Container>
            </div>
          </Carousel.Item>
        </Carousel>

        {/* Main Content */}
        <main>
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/events" element={<Events />} />
            <Route path="/gallery" element={<Gallery />} />
            <Route path="/membership" element={<Membership />} />
            <Route path="/contact" element={<Contact />} />

            {/* Admin Routes */}
            <Route path="/admin" element={<AdminLogin />} />
            <Route
              path="/admin/dashboard"
              element={
                <ProtectedRoute>
                  <AdminDashboard />
                </ProtectedRoute>
              }
            />
          </Routes>
        </main>

        {/* Footer */}
        <footer className="bg-dark text-light py-5">
          <Container>
            <Row>
              <Col md={4}>
                <h5>About Us</h5>
                <p>Edo Cultural Association Italy is dedicated to preserving and promoting Edo culture in Italy.</p>
              </Col>
              <Col md={4}>
                <h5>Quick Links</h5>
                <ul className="list-unstyled">
                  <li><Link to="/" className="text-light">Home</Link></li>
                  <li><Link to="/about" className="text-light">About</Link></li>
                  <li><Link to="/events" className="text-light">Events</Link></li>
                  <li><Link to="/contact" className="text-light">Contact</Link></li>
                </ul>
              </Col>
              <Col md={4}>
                <h5>Follow Us</h5>
                <div className="social-links">
                  <a href="#" className="text-light me-3"><i className="fab fa-facebook"></i></a>
                  <a href="#" className="text-light me-3"><i className="fab fa-instagram"></i></a>
                  <a href="#" className="text-light me-3"><i className="fab fa-twitter"></i></a>
                  <a href="#" className="text-light"><i className="fab fa-youtube"></i></a>
                </div>
              </Col>
            </Row>
            <Row className="mt-4">
              <Col className="text-center">
                <p className="mb-0">&copy; 2024 Edo Cultural Association Italy. All rights reserved.</p>
              </Col>
            </Row>
          </Container>
        </footer>

        {/* Scroll to Top Button */}
        {showScrollTop && (
          <Button 
            variant="primary" 
            className="scroll-top rounded-circle"
            onClick={scrollToTop}
          >
            <i className="fas fa-arrow-up"></i>
